import React, { useState, useRef, useCallback } from 'react';
import { Form, Button, message, Card, Upload } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import type { UploadFile, UploadProps } from 'antd/es/upload/interface';
import type { RcFile } from 'antd/es/upload';
import axios from 'axios';

const Training: React.FC = () => {
  const [form] = Form.useForm();
  const [loading, setLoading] = useState(false);
  const [trainingResult, setTrainingResult] = useState<any>(null);
  const selectedFileRef = useRef<RcFile | null>(null);

  const [fileNameForDisplay, setFileNameForDisplay] = useState<string | null>(null);

  const onFinish = useCallback(async () => {
    const fileToRead = selectedFileRef.current;

    if (!fileToRead) {
      message.error('错误：训练数据文件未选择或加载失败。');
      setLoading(false);
      return;
    }

    setLoading(true);

    const reader = new FileReader();

    reader.onload = async (e) => {
      try {
        const decoder = new TextDecoder('utf-16le');
        const content = decoder.decode(e.target?.result as ArrayBuffer);
        const values = JSON.parse(content);

        const response = await axios.post('/api/train', values);

        message.success('训练成功！');
        setTrainingResult(response.data.parameters);
        console.log('训练结果:', response.data);
      } catch (error: any) {
        console.error('训练失败:', error);
        console.log('Backend Error Response (from axios error):', error.response);
        let errorMessage = '训练失败：';
        if (error.response && error.response.data && typeof error.response.data.detail === 'object') {
          if (error.response.data.detail.message) {
            errorMessage += error.response.data.detail.message + '\n';
          }
          if (error.response.data.detail.errors && Array.isArray(error.response.data.detail.errors)) {
            error.response.data.detail.errors.forEach((err: any) => {
              errorMessage += `  字段: ${err.loc ? err.loc.join('.') : '未知'}, 错误: ${err.msg}\n`;
            });
          }
        } else if (error.response && error.response.data && error.response.data.detail) {
          errorMessage += error.response.data.detail;
        } else {
          errorMessage += error.message || String(error);
        }
        message.error(errorMessage);
        setTrainingResult(null);
      } finally {
        setLoading(false);
      }
    };

    reader.onerror = (e) => {
      message.error('文件读取发生内部错误。');
      setLoading(false);
      console.error('FileReader error:', e);
    };

    reader.readAsArrayBuffer(fileToRead);
  }, []);

  const uploadProps: UploadProps = {
    name: 'file',
    accept: '.json',
    maxCount: 1,
    fileList: fileNameForDisplay ? [{
      uid: '1',
      name: fileNameForDisplay,
      status: 'done',
      size: 0,
      type: 'application/json',
      originFileObj: selectedFileRef.current || undefined,
    }] : [],
    onRemove: () => {
      selectedFileRef.current = null;
      setFileNameForDisplay(null);
      message.info(`已移除文件`);
      return true;
    },
    beforeUpload: (file) => {
      const isJson = file.type === 'application/json' || file.name.endsWith('.json');
      if (!isJson) {
        message.error('只能上传 JSON 文件!');
        return Upload.LIST_IGNORE;
      }

      selectedFileRef.current = file;
      setFileNameForDisplay(file.name);
      message.success(`${file.name} 文件已选择，点击 "开始训练"。`);
      return false;
    },
  };

  return (
    <Card title="参数训练">
      <Form
        form={form}
        layout="vertical"
        onFinish={onFinish}
      >
        <Form.Item
          label="训练数据集 (JSON 文件)"
          rules={[{ required: true, message: '请上传训练数据文件' }]}
        >
          <Upload {...uploadProps}>
            <Button icon={<UploadOutlined />} disabled={!!fileNameForDisplay}>上传训练数据集 (仅限 JSON)</Button>
          </Upload>
          {fileNameForDisplay && <p>已选择文件: {fileNameForDisplay}</p>}
        </Form.Item>

        <Form.Item>
          <Button type="primary" htmlType="submit" loading={loading} disabled={!fileNameForDisplay || loading}>
            开始训练
          </Button>
        </Form.Item>
      </Form>

      {trainingResult && (
        <Card title="训练结果" style={{ marginTop: '20px' }}>
          <p><strong>训练Tag:</strong> {trainingResult.tag || trainingResult.name}</p>
          <p><strong>系数 (w):</strong> {JSON.stringify(trainingResult.w)}</p>
          <p><strong>截距 (b):</strong> {trainingResult.b}</p>
        </Card>
      )}
    </Card>
  );
};

export default Training;
